  true,\n\t\"url\": null,\n\t\"notes\": \"<p>2010-2016.  National Quitline Data Warehouse
  (NQDW). State Tobacco Activities Tracking and Evaluation (STATE) System.  NQDW Data.
  \ National Quitline Data Warehouse (NQDW) assists in evaluating quitline activities
  and serves as a national resource for data on the use, success, and services of
  state quitlines.  States report data on quitline callers, quitting success, as well
  as the services provided by their quitlines. The NQDW consolidates this information
  for evaluating programs and improving quitline services.  The jurisdictions participating
  in this data collection effort include the 50 states, the District of Columbia,
  Guam and Puerto Rico.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
